import './button.css';

export default function Button({obj}){

    let title=obj.title;
    let icon=obj.icon;
    let img=obj.img;
    let img2=`<img src=${img}></img>`
    
    return(
    
        <button>{title}
        {icon}
        {img2}
         </button>
    );
}
